	const [title, setTitle] = useState('');

	const titleList = [];
	Object.keys(animeList).map((animeInfo) => {
		<div>animeList[animeInfo].title</div>;
	});

	useEffect(() => {
		Object.keys(animeList).map((animeInfo) => {
			setTitle({
				title: animeList[animeInfo].title,
			});
		});
	});

	return (
		<>
			<button onClick={createAnimeList}>test</button>
		</>
	);
};

export default Detail;
